select a.name, a.cif, a.account_number as number, a.creation_date, b.name as bankname, b.code, c.type as typename, d.country,d.currname,d.abbrev from bankaccount a INNER JOIN bank b on a.bank_id=b.id INNER JOIN cardtype c on a.type_id = c.id INNER JOIN (select a.name as country,a.code,a.alpha2,a.alpha3,b.name as currname,b.abbrev from country a LEFT OUTER JOIN (select name,abbrev,code from currency group by name,abbrev,code) b on b.code = a.code) d on b.code = d.code where a.customer_id = 24

































  
  
  
  
  
  
  
  
  
  
  
  
  
  
  
  
 


